import React, { useState } from 'react'

export default function Navbar() {


    let [inputValue,setInputValue]=useState('')
    
    
    const handleinputchange=(e)=>
    {
        setInputValue(e.target.value)
    }
    
    const handleSearchBtn = (event) => {
        event.preventDefault();
        console.log(inputValue)
        setInputValue(' ');
    }
    
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#">Navbar</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <a className="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                        </ul>
                        <form className="d-flex" role="search">
                            <input className="form-control me-2" value={inputValue}  onChange={handleinputchange} type="text" placeholder="Search" aria-label="Search" />
                            <button className="btn btn-outline-success"  onClick={handleSearchBtn} type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </nav>
        </div>
    )
}
